import React, {Component} from 'react'
import { MdClose } from 'react-icons/md'
import Input from '../Input/Input'
import SampleBtn from '../SampleBtn/SampleBtn'
import './Modal.css'

class Modal extends Component {
    constructor(props){
        super(props)

    }

    sendData = (event) => {
        event.preventDefault()
        this.setState({ data: true })
    }

    render(props) {
        return (
            <section className="modal-main">
                <form className="modal-nomadi" >
                    <button className="button-close" onClick={this.props.onClickClose}>
                        <MdClose />
                    </button>
                    <fiedlset className="title-modal">
                        <h3>{this.props.h3}</h3>
                        <h5>{this.props.h5}</h5>
                    </fiedlset>
                    <fieldset className="inputs-modal">
                        <Input
                            htmlFor={this.props.htmlFor1} 
                            id={this.props.id1}
                            type={this.props.type1}
                            name={this.props.name1}
                            value={this.props.value1}
                            children={this.props.children1}/>
                        <Input
                            htmlFor={this.props.htmlFor2} 
                            id={this.props.id2}
                            type={this.props.type2}
                            name={this.props.name2}
                            value={this.props.value2}
                            children={this.props.children2}/>
                    </fieldset>
                    <div className="button-modal">
                        <SampleBtn onClick={this.props.onClick}>Enviar</SampleBtn>
                    </div>
                </form>
            </section>
        )
    }
}
export default Modal
